import React from 'react';
import logoImg from '../../assets/logo.svg'

// import { Container } from './styles';

const Main: React.FC = () => {
  return (
      <div className="main">
          <div className="text">
            <h1>The video platform DAO</h1>
            <h2>Joystream is a video platform controlled,
                owned, and operated by its users
            </h2>
          </div>
          <div className="image">
              <img src={logoImg} alt='imagem de logo' />
          </div>
      </div>
  );
}

export default Main;
